import React, { useEffect, useState } from 'react';
import { View, Text, TextInput, Button, StyleSheet, StatusBar } from 'react-native';
import MapView, { Marker } from 'react-native-maps';
import * as Location from 'expo-location';

const Profil = ({ navigation }) => {
    const [markers, setMarkers] = useState([]);
    const [searchInput, setSearchInput] = useState('');
    const [lat, setLat] = useState(null);
    const [lon, setLon] = useState(null);
    const [locationPermissionGranted, setLocationPermissionGranted] = useState(false);

    const fetchData = async () => {
        try {
            if (!searchInput) {
                console.error('Veuillez entrer une ville.');
                // return;
            }
            else {
                // const response = await fetch(`https://oudonner.api.efs.sante.fr/carto-api/v3/samplingcollection/searchbycityname?CityName=${searchInput}&UserLatitude=${lat}&UserLongitude=${lon}`);
                const response = await fetch(`https://oudonner.api.efs.sante.fr//carto-api/v3/ping`);
                const data = await response.json();
                if (!response.ok) {
                    throw new Error('Erreur de réseau - Réponse non valide');
                }
                console.log(data);
            }
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    useEffect(() => {
        getLocation();
        // fetchData();
    }, [lat, lon]);

    useEffect(() => {
        (async () => {
            const { status } = await Location.requestForegroundPermissionsAsync();
            if (status === 'granted') {
                const location = await Location.getCurrentPositionAsync({ accuracy: Location.Accuracy.Highest });
                setLat(location.coords.latitude);
                setLon(location.coords.longitude);
                console.log('Latitude:', location.coords.latitude);
                console.log('Longitude:', location.coords.longitude);
            } else {
                console.log('Permission to access location was denied');
            }
        })();
    }, []);

    const handleSearch = () => {
        console.log('Recherche:', searchInput);
        fetchData();
    };

    const getLocation = async () => {
        const { status } = await Location.requestForegroundPermissionsAsync();
        if (status === 'granted') {
            const location = await Location.getCurrentPositionAsync({ accuracy: Location.Accuracy.Highest });
            setLat(location.coords.latitude);
            setLon(location.coords.longitude);
            console.log('Latitude:', location.coords.latitude);
            console.log('Longitude:', location.coords.longitude);
        } else {
            console.log('Permission to access location was denied');
        }
    };

    return (
        <View style={styles.container}>
            <StatusBar translucent backgroundColor="transparent" />
            <View style={styles.searchContainer}>
                <TextInput
                    style={styles.input}
                    placeholder="Entrez une ville"
                    value={searchInput}
                    onChangeText={text => setSearchInput(text)}
                />
                <Button title="Rechercher" onPress={handleSearch} />
            </View>
            <Text>Latitude: {lat}</Text>
            <Text>Longitude: {lon}</Text>

            <MapView
                style={styles.map}
                initialRegion={{
                    latitude: lat || 37.78825,
                    longitude: lon || -122.4324,
                    latitudeDelta: 0.0922,
                    longitudeDelta: 0.0421,
                }}
            >
                {/* {markers.map(marker => (
                    <Marker
                        key={marker.id}
                        coordinate={{ latitude: marker.latitude, longitude: marker.longitude }}
                        title={marker.title}
                        description={marker.description}
                    />
                ))} */}
            </MapView>

        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    searchContainer: {
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'center',
        padding: 10,
        marginTop: StatusBar.currentHeight || 0,
    },
    input: {
        flex: 1,
        borderWidth: 1,
        borderColor: '#ccc',
        borderRadius: 5,
        paddingHorizontal: 10,
        marginRight: 10,
    },
    map: {
        flex: 1,
        width: '100%',
        height: '100%',
    },
});

export default Profil;
